import { Link } from "react-router-dom";
function Product(props){
  const obj = props.obj;


  return (<Link to={`/product:${props.id}`} className="Product">
    <img src={obj.img}/>
    <label className="name">{obj.name}</label>
    <label className="price">{obj.price}</label>
  </Link>)
}

export default Product;
